// PUBLIC MEMBERS
///////////////////////////////////////////////////////////////////////////
// METHODE    : CChannel
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
CChannel::CChannel()
{
	CData data;
	for (int i=0; i<CDefinition::E_MAXELEM; i++)
	{
		m_mpData[i]=data;
		m_mpData[i].setType(i);
	}

	// mise à jour des données dépendantes
	m_mpData[CDefinition::E_MODULATION].m_vcLinkedData.push_back(&m_mpData[CDefinition::E_BFO]);
	m_mpData[CDefinition::E_MODULATION].m_vcLinkedData.push_back(&m_mpData[CDefinition::E_AGC]);
	m_mpData[CDefinition::E_MODULATION].m_vcLinkedData.push_back(&m_mpData[CDefinition::E_BAUD]);
	m_mpData[CDefinition::E_CHANNEL].m_vcLinkedData.push_back(&m_mpData[CDefinition::E_HIGHSELECT]);

	// connection en série
	m_ctelec8025.connectrs232(_T("\\\\.\\COM1"), 19200, 8, stcommunicator_rs232::oneStopBit, stcommunicator_rs232::noParity);
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : ~CChannel
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
CChannel::~CChannel()
{
	m_ctelec8025.disconnect();
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : setValue
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
bool CChannel::setValue(int id, double value)
{
	bool ret = false;
	if (!m_isConnected)
		return false;
	std::map<int, CData>::iterator iter = m_mpData.find(id);
	if (iter != m_mpData.end())
	{
		if (iter->second.isValid(value))
		{
			if (sendCalValue(iter->first,value))
				ret = iter->second.setValue(value);
		}
	}
	if (ret == true)
		updateOthers(id, value);
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : nextValue
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
double CChannel::nextValue(int id)
{
	double ret = 0;
	std::map<int, CData>::iterator iter = m_mpData.find(id);
	if (iter != m_mpData.end())
		ret = (++(iter->second)).getValue();
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : getValue
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
double CChannel::getValue(int id)
{
	double ret = 0;
	std::map<int, CData>::iterator iter = m_mpData.find(id);
	if (iter != m_mpData.end())
		ret = iter->second.getValue();
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : getData
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
CData CChannel::getData(int id)
{
	double ret = 0;
	std::map<int, CData>::iterator iter = m_mpData.find(id);
	return iter->second;
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : getStatus
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
bool CChannel::getStatus()
{
	bool ret = false;
	if (!m_isConnected)
		return false;
	telec8025::t_channelstatus channelStatus;
	channelStatus.mask = telec8025::PRS_ALL;
	if (m_ctelec8025.getstatus((int)getValue(CDefinition::E_CHANNEL),channelStatus))
	{
		// les valeurs sont celle de l'appareil, donc pas besoin de les mettre à jour dans le telec8525
		m_mpData[CDefinition::E_FREQUENCY].setValue((double)channelStatus.freq);
		m_mpData[CDefinition::E_MODULATION].setValue(getModulation(channelStatus));
		m_mpData[CDefinition::E_FILTER].setValue((double)abs(getFilterFromValue(channelStatus.bandwidth.bandwidth)));
		updateOthers(CDefinition::E_MODULATION, m_mpData[CDefinition::E_MODULATION].getValue());
		ret = true;
	}
	return ret;
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : getStatus
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
void CChannel::connect()
{
	m_isConnected = m_ctelec8025.ackmode((int)getValue(CDefinition::E_CHANNEL),telec8025::AN1);
	if(m_isConnected)
		m_ctelec8025.setprs((int)getValue(CDefinition::E_CHANNEL),telec8025::PRS_F | telec8025::PRS_D | telec8025::PRS_B);
}


// PROTECTED MEMBERS
///////////////////////////////////////////////////////////////////////////
// METHODE    : sendCalValue
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
bool CChannel::sendCalValue(int id, double value)
{
	bool ret= true;
	int voie = (int)getValue(CDefinition::E_CHANNEL);
	switch(id)
	{
	case CDefinition::E_FREQUENCY: // envoi de la fréquence
		OutputGenTrace(_T("CChannel::sendCalValue - envoi de la fréquence\n"));
		ret = m_ctelec8025.configFrequency(voie,(unsigned long)value);
		OutputGenTrace(_T("CChannel::sendCalValue - fin envoi de la fréquence\n"));
		break;
	case CDefinition::E_MODULATION: // envoi de la modulation
		ret = sendModulation(voie, (CDefinition::E_Modulation)((int)value));
		break;
	case CDefinition::E_FILTER:
		ret = sendBandwidth(voie, (int)value, (CDefinition::E_Modulation)((int)m_mpData[CDefinition::E_MODULATION].getValue()));
		break;
	default:
		break;
	}
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : sendModulation
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
bool CChannel::sendModulation(int voie, CDefinition::E_Modulation value)
{
	bool ret= true;
	CMyTelec8025::D_prm_mod mod;
	switch(value)
	{
	case CDefinition::E_A1A:
		mod = CMyTelec8025::A1A;
		break;
	case CDefinition::E_A3E:
		mod = CMyTelec8025::A3E;
		break;
	case CDefinition::E_J3E_PLUS:
		mod = CMyTelec8025::J3E;
		ret = setValue(CDefinition::E_PASSBAND, 300);
		break;
	case CDefinition::E_J3E_MOINS:
		mod = CMyTelec8025::J3E;
		ret = setValue(CDefinition::E_PASSBAND, 300);
		break;
	case CDefinition::E_H3E_PLUS:
		mod = CMyTelec8025::H3E;
		ret = setValue(CDefinition::E_PASSBAND, 300);
		break;
	case CDefinition::E_H3E_MOINS:
		mod = CMyTelec8025::H3E;
		ret = setValue(CDefinition::E_PASSBAND, 300);
		break;
	case CDefinition::E_G3E:
		mod = CMyTelec8025::G3E;
		break;
	case CDefinition::E_F1B:
		mod = CMyTelec8025::F1B;
		break;
	case CDefinition::E_F3E:
		mod = CMyTelec8025::F3E;
		break;
	default:
		ret = false;
		break;
	}
	if (ret)
		ret = m_ctelec8025.configModulation(voie,mod);
	return ret;
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : sendModulation
// CLASSE     : CChannel
///////////////////////////////////////////////////////////////////////////
CDefinition::E_Modulation CChannel::getModulation(const telec8025::t_channelstatus channelStatus )
{
	bool ret= true;
	CDefinition::E_Modulation mod;
	switch(channelStatus.mod)
	{
	case CMyTelec8025::A1A:
		mod = CDefinition::E_A1A;
		break;
	case CMyTelec8025::A3E:
		mod = CDefinition::E_A3E;
		break;
	case CMyTelec8025::J3E:
		if (channelStatus.bandwidth.bandwidth>0)
			mod = CDefinition::E_J3E_PLUS;
		else
			mod = CDefinition::E_J3E_MOINS;
		break;
	case CMyTelec8025::H3E:
		if (channelStatus.bandwidth.bandwidth>0)
			mod = CDefinition::E_H3E_PLUS;
		else
			mod = CDefinition::E_H3E_MOINS;
		break;
	case CMyTelec8025::G3E:
		mod = CDefinition::E_G3E;
		break;
	case CMyTelec8025::F1B:
		mod = CDefinition::E_F1B;
		break;
	case CMyTelec8025::F3E:
		mod = CDefinition::E_F3E;
		break;
	default:
		ret = false;
		break;
	}
	return mod;

}

