///////////////////////////////////////////////////////////////////////////
// METHODE    : dataInitialisation
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
bool CChannelHF::dataInitialisation()
{
	// initialisation du numéro de la voie
	m_mpData[CDefinition::E_CHANNEL].setMin(1); 
	m_mpData[CDefinition::E_CHANNEL].setMax(2); 
	m_mpData[CDefinition::E_CHANNEL].setStep(0); 
	bool ret = m_mpData[CDefinition::E_CHANNEL].setValue(1); 

	// initialisation de la fréquence (en centaine de Hz)
	m_mpData[CDefinition::E_FREQUENCY].setMin(300); 
	m_mpData[CDefinition::E_FREQUENCY].setMax(30000000); 
	m_mpData[CDefinition::E_FREQUENCY].setStep(10); 
	ret &= m_mpData[CDefinition::E_FREQUENCY].setValue(1000000);

	// initialisation de la modulation
	m_mpData[CDefinition::E_MODULATION].setMin(0); 
	m_mpData[CDefinition::E_MODULATION].setMax(CDefinition::E_MAXELEM_MOD - 1); 
	m_mpData[CDefinition::E_MODULATION].setStep(1); 
	ret &= m_mpData[CDefinition::E_MODULATION].setValue(CDefinition::E_A1A);

	// initialisation du filtre 
	m_mpData[CDefinition::E_FILTER].setMin(0); 
	m_mpData[CDefinition::E_FILTER].setMax(E_MAXELEM_FILTRE -1); 
	m_mpData[CDefinition::E_FILTER].setStep(1); 
	ret &= m_mpData[CDefinition::E_FILTER].setValue(E_4K);

	// initialisation du BFO
	m_mpData[CDefinition::E_BFO].setMin(-10000); 
	m_mpData[CDefinition::E_BFO].setMax(10000); 
	m_mpData[CDefinition::E_BFO].setStep(10); 
	m_mpData[CDefinition::E_BFO].allowModification(true);// A1A authorise 
	ret &= m_mpData[CDefinition::E_BFO].setValue(0);

	// initialisation du High Select
	m_mpData[CDefinition::E_HIGHSELECT].setMin(0); 
	m_mpData[CDefinition::E_HIGHSELECT].setMax(1); 
	m_mpData[CDefinition::E_HIGHSELECT].setStep(1); 
	m_mpData[CDefinition::E_HIGHSELECT].allowModification(true);
	ret &= m_mpData[CDefinition::E_HIGHSELECT].setValue(0);

	// initialisation du controle de gain automatique
	m_mpData[CDefinition::E_AGC].setMin(0); 
	m_mpData[CDefinition::E_AGC].setMax(4); 
	m_mpData[CDefinition::E_AGC].setStep(1); 
	m_mpData[CDefinition::E_AGC].allowModification(true);
	ret &= m_mpData[CDefinition::E_AGC].setValue(0);

	// initialisation du baud
	m_mpData[CDefinition::E_BAUD].setMin(0); 
	m_mpData[CDefinition::E_BAUD].setMax(1); 
	m_mpData[CDefinition::E_BAUD].setStep(1); 
	m_mpData[CDefinition::E_BAUD].allowModification(false);
	ret &= m_mpData[CDefinition::E_BAUD].setValue(0);

	return ret;
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : sendBandwidth
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
bool CChannelHF::sendBandwidth(int voie, int value, CDefinition::E_Modulation mod)
{
	bool ret= true;
	CMyTelec8025::B_msg bandwidth;
	bandwidth.bandwidth = getFilterFromIndex(value);
	// selection du mode HF 20kHz ou HF 300kHz
	if (bandwidth.bandwidth<30000)
			bandwidth.ibrtype = 1;	// mode HF 20kHz
		else
			bandwidth.ibrtype = 2;	// mode HF 300kHz

	// positionnement du filtre pour les démodulations asymétriques
	if (mod == CDefinition::E_J3E_MOINS || mod == CDefinition::E_H3E_MOINS)
		bandwidth.bandwidth = -bandwidth.bandwidth;

	if (ret)
		ret = m_ctelec8025.configBandwidth(voie, bandwidth);
	return ret;
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : getStep
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
int CChannelHF::getStep(CDefinition::E_StepType type)
{
	int ret;
	switch(type)
	{
	case CDefinition::E_MEDSTEP:
		ret = 200;
		break;
	case CDefinition::E_FASTSTEP:
		ret = 5000;
		break;
	case CDefinition::E_SLOWSTEP:
	default:
		ret = int(m_mpData[CDefinition::E_FREQUENCY].getStep());
		break;
	}
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : getFilterCount
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
int CChannelHF::getFilterCount()
{
	if ((int)m_mpData[CDefinition::E_MODULATION].getValue() == CDefinition::E_G3E)
		return E_8K + 1;
	else 
		return E_MAXELEM_FILTRE;
}

