///////////////////////////////////////////////////////////////////////////
// METHODE    : updateOthers
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
void CChannelHF::updateOthers(int id, double value)
{
	switch(id)
	{
	case CDefinition::E_MODULATION:
		switch((int)value)
		{
		case CDefinition::E_A1A:
			m_mpData[CDefinition::E_BFO].allowModification(true);// A1A authorise 
			m_mpData[CDefinition::E_BAUD].allowModification(false); 
			break;
		case CDefinition::E_F1B:
			m_mpData[CDefinition::E_BAUD].allowModification(true); 
			m_mpData[CDefinition::E_BFO].allowModification(true);// A1A authorise 
			break;
		case CDefinition::E_A3E:
		case CDefinition::E_J3E_PLUS:
		case CDefinition::E_J3E_MOINS:
		case CDefinition::E_H3E_PLUS:
		case CDefinition::E_H3E_MOINS:
		case CDefinition::E_G3E:
		case CDefinition::E_F3E:
		default:
			m_mpData[CDefinition::E_BFO].allowModification(false);// non authorisé 
			m_mpData[CDefinition::E_BAUD].allowModification(false); 
			break;
		}
		if (m_mpData[CDefinition::E_FILTER].getValue() >= getFilterCount())
			setValue(CDefinition::E_FILTER, getFilterCount()-1);
		break;
	default:
		break;
	}

}

