///////////////////////////////////////////////////////////////////////////
// METHODE    : getFilterCount
// CLASSE     : CChannelHF
///////////////////////////////////////////////////////////////////////////
int CChannelVU::getFilterCount()
{
	int max = E_MAXELEM_FILTRE;
	switch((int)m_mpData[CDefinition::E_MODULATION].getValue())
	{
	case CDefinition::E_A1A:
		max = E_30K + 1;
		break;
	case CDefinition::E_J3E_PLUS:
	case CDefinition::E_J3E_MOINS:
	case CDefinition::E_H3E_PLUS:
	case CDefinition::E_H3E_MOINS:
	case CDefinition::E_F1B:
		max = E_15K + 1;
		break;
	case CDefinition::E_G3E:
		max = E_8K + 1;
		break;
	default:
		max = E_MAXELEM_FILTRE;
		break;
	}
	return max;
}

