CEditColor::CEditColor(void)
{
	// création de la couleur par défaut
	m_brush.CreateSysColorBrush(COLOR_BTNFACE);

	// on spécifie que l'on utilise la font par défaut
	bFont = false;
}

CEditColor::~CEditColor(void)
{
}



