	//{{AFX_MSG_MAP(CEditColor)
	ON_WM_CTLCOLOR_REFLECT()
	ON_WM_PAINT()
	//}}AFX_MSG_MAP
END_MESSAGE_MAP()

/////////////////////////////////////////////////////////////////////////////
// CEditColor message handlers

HBRUSH CEditColor::CtlColor(CDC* pDC, UINT nCtlColor) 
{
	// TODO: Change any attributes of the DC here
	// affectation a la couleur de fond du texte de la couleur 
	// du control
	LOGBRUSH bsh;
	m_brush.GetLogBrush(&bsh);
	switch(e_modifyColor)
	{
		case BACKGROUND :
			pDC->SetBkColor(bsh.lbColor);
			break;
		case TEXT :
			pDC->SetBkColor(bsh.lbColor);
			switch(e_textColor)
			{
			case RED:
				pDC->SetTextColor(RGB(255,0,0));
				break;
			case GREEN:
				pDC->SetTextColor(RGB(0,255,0));
				break;
			case BLUE:
				pDC->SetTextColor(RGB(0,0,255));
				break;
			case BLACK:
				pDC->SetTextColor(RGB(0,0,0));
				break;
			case WHITE:
				pDC->SetTextColor(RGB(255,255,255));
				break;
			default:
				pDC->SetTextColor(RGB(0,0,0));
				break;
			}
			m_brush.DeleteObject();
			m_brush.CreateSysColorBrush(COLOR_BTNFACE);
			break;
		default : 
			pDC->SetBkColor(bsh.lbColor);
			pDC->SetTextColor(RGB(0,0,0));
			m_brush.DeleteObject();
			m_brush.CreateSysColorBrush(COLOR_BTNFACE);
			break;
	}

	// retour du bruch défini pour modification de la couleur du 
	// control statique
	return m_brush;	
}

// affecte la nouvelle couleur au control statique
void CEditColor::SetNewColor(COLORREF color)
{
	// Modification de la couleur du fond
	e_modifyColor = BACKGROUND;

	// on supprime l'objet brush en cours
	m_brush.DeleteObject();

	// création du nouvel objet
	m_brush.CreateSolidBrush(color);	
}

// affecte la nouvelle couleur au texte
void CEditColor::SetNewTextColor(textColor e_ptextColor)
{
	// Modification de la couleur du texte
	e_modifyColor = TEXT;
	e_textColor = e_ptextColor;

	// on supprime l'objet brush en cours
	m_brush.DeleteObject();

	// création du nouvel objet
	m_brush.CreateSysColorBrush(COLOR_BTNFACE);	
}

void CEditColor::SetNewFont(int nHeight)
{
	// création de la font
	m_font.DeleteObject();
	m_font.CreateFont(nHeight,                    // nHeight
					   0,                         // nWidth
					   0,                         // nEscapement
					   0,                         // nOrientation
					   FW_BOLD,                   // nWeight
					   FALSE,                     // bItalic
					   FALSE,                     // bUnderline
					   0,                         // cStrikeOut
					   ANSI_CHARSET,              // nCharSet
					   OUT_DEFAULT_PRECIS,        // nOutPrecision
					   CLIP_DEFAULT_PRECIS,       // nClipPrecision
					   DEFAULT_QUALITY,           // nQuality
					   DEFAULT_PITCH | FF_SWISS,  // nPitchAndFamily
					   _T("Arial"));                 // lpszFacename
	bFont = false;

	// affectation de la font
	SetFont(&m_font);
		
}

