// PUBLIC MEMBERS
///////////////////////////////////////////////////////////////////////////
// METHODE    : CEquipement
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
CEquipement::CEquipement(void)
{
	if (!m_mpChannel.empty())
		m_mpChannel.clear();
	CChannelHF* pchannelHF = new CChannelHF();
	if (pchannelHF)
	{
		m_mpChannel.push_back(pchannelHF);
		CChannelVU* pchannelVU = new CChannelVU();
		if (pchannelVU)
			m_mpChannel.push_back(pchannelVU);
	}
	m_pCurrentChannel = NULL;
	setCurrentChannel(1);


}

///////////////////////////////////////////////////////////////////////////
// METHODE    : ~CEquipement
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
CEquipement::~CEquipement(void)
{
	for (unsigned int i = 0; i<m_mpChannel.size(); i++)
	{
		if (m_mpChannel[i] != NULL)
			delete m_mpChannel[i];
	}
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : setValue
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
bool CEquipement::setValue(int id, double value)
{
	bool ret = false;
	// mise à jour de la voie
	if (id == CDefinition::E_CHANNEL)
	{
		if(!setCurrentChannel(value))
			return false;
	}
	// mise à jour des autres éléments
	return m_pCurrentChannel->setValue(id,value);
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : nextValue
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
double CEquipement::nextValue(int id)
{
	return m_pCurrentChannel->nextValue(id);
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : getValue
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
double CEquipement::getValue(int id)
{
	return m_pCurrentChannel->getValue(id);
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : getData
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
CData CEquipement::getData(int id)
{
	return m_pCurrentChannel->getData(id);
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : getStatus
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
bool CEquipement::getStatus()
{
	return m_pCurrentChannel->getStatus();
}
// PROTECTED MEMBERS
///////////////////////////////////////////////////////////////////////////
// METHODE    : getStatus
// CLASSE     : CEquipement
///////////////////////////////////////////////////////////////////////////
bool CEquipement::setCurrentChannel(int voie)
{
	bool ret = false;
	if (voie>0 && voie<=m_mpChannel.size())
	{
		m_pCurrentChannel = m_mpChannel[voie-1];
		ret = true;
//		ret = m_pCurrentChannel->getStatus();
	}
	return ret;
}

