	m_BFOBtn.setDisplayType(CLedButton::E_EDIT);
	m_BFOBtn.setEqt(CDefinition::E_BFO);
	m_mpEqtLinkedBtn[CDefinition::E_BFO]=&m_BFOBtn;
	
	m_HighSelectBtn.setLedColor(CLedButton::E_NO_LED);
	m_HighSelectBtn.setEdit(NULL);
	m_HighSelectBtn.setDisplayType(CLedButton::E_EDIT);
	m_HighSelectBtn.setEqt(CDefinition::E_HIGHSELECT);
	m_mpEqtLinkedBtn[CDefinition::E_HIGHSELECT]=&m_HighSelectBtn;
	
	m_AGCBtn.setLedColor(CLedButton::E_NO_LED);
	m_AGCBtn.setEdit(NULL);
	m_AGCBtn.setDisplayType(CLedButton::E_EDIT);
	m_AGCBtn.setEqt(CDefinition::E_AGC);
	m_mpEqtLinkedBtn[CDefinition::E_AGC]=&m_AGCBtn;
	
	m_BaudBtn.setLedColor(CLedButton::E_NO_LED);
	m_BaudBtn.setEdit(NULL);
	m_BaudBtn.setDisplayType(CLedButton::E_EDIT);
	m_BaudBtn.setEqt(CDefinition::E_BAUD);
	m_mpEqtLinkedBtn[CDefinition::E_BAUD]=&m_BaudBtn;
	
	m_frequencyEdt.SetNewFont(35);
	m_ErrorEdt.SetNewTextColor(CEditColor::RED);

	// Gestion du message de connection
	m_cEquipement.setValue(CDefinition::E_CHANNEL,1);
	displayConnecting(true);
	SetTimer(ID_TIMER_CONNECTION, 5000, NULL);

	// affiche les valeurs par défaut
	refreshCombos();
	displayResume();
	UpdateData(FALSE);
	
	return TRUE;  // retourne TRUE, sauf si vous avez défini le focus sur un contrôle
}

// Si vous ajoutez un bouton Réduire à votre boîte de dialogue, vous devez utiliser le code ci-dessous
//  pour dessiner l'icône. Pour les applications MFC utilisant le modèle Document/Vue,
//  cela est fait automatiquement par l'infrastructure.

void CFrontEndDlg::OnPaint() 
{
	if (IsIconic())
	{
		CPaintDC dc(this); // contexte de périphérique pour la peinture

		SendMessage(WM_ICONERASEBKGND, reinterpret_cast<WPARAM>(dc.GetSafeHdc()), 0);

		// Centrer l'icône dans le rectangle client
		int cxIcon = GetSystemMetrics(SM_CXICON);
		int cyIcon = GetSystemMetrics(SM_CYICON);
		CRect rect;
		GetClientRect(&rect);
		int x = (rect.Width() - cxIcon + 1) / 2;
		int y = (rect.Height() - cyIcon + 1) / 2;

		// Dessiner l'icône
		dc.DrawIcon(x, y, m_hIcon);
	}
	else
	{
		CDialog::OnPaint();
	}
}

// Le système appelle cette fonction pour obtenir le curseur à afficher lorsque l'utilisateur fait glisser
//  la fenêtre réduite.
HCURSOR CFrontEndDlg::OnQueryDragIcon()
{
	return static_cast<HCURSOR>(m_hIcon);
}
void CFrontEndDlg::OnCancel()
{
	if(m_cEquipement.isConnected())
		OnBnClickedCe();
	GetDlgItem(IDB_CE)->SetFocus();
}
void CFrontEndDlg::OnOK()
{
	if(m_cEquipement.isConnected())
		OnBnClickedEnter();
	GetDlgItem(IDB_ENTER)->SetFocus();
}
void CFrontEndDlg::OnClose()
{
	EndDialog(0);
}


// PROTECTED MEMBERS
///////////////////////////////////////////////////////////////////////////
// METHODE    : displayResume
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::displayResume()
{
	double adr, freq;

	adr = m_cEquipement.getValue(CDefinition::E_CHANNEL);
	m_iAdrEdt = (int)adr;
	
	freq = m_cEquipement.getValue(CDefinition::E_FREQUENCY);
	m_dFreqEdt = freq/1000; //en kHz

	m_iModCB = int(m_cEquipement.getValue(CDefinition::E_MODULATION));

	m_iFilterCB = int(m_cEquipement.getValue(CDefinition::E_FILTER));

	UpdateData(FALSE);
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : refreshCombos
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
bool CFrontEndDlg::refreshCombos()
{
	// Modulation
	((CComboBox*)GetDlgItem(IDC_MOD))->ResetContent();
	for (int i=0; i<CDefinition::E_MAXELEM_MOD; i++)
		((CComboBox*)GetDlgItem(IDC_MOD))->InsertString(-1,CDefinition::getModulationNameFromEnum(CDefinition::E_Modulation(i)));

	// filter
	CString text;
	((CComboBox*)GetDlgItem(IDC_FILTER))->ResetContent();
	for (int i=0; i<m_cEquipement.getFilterCount(); i++)
	{
		text.Format(_T("%0.2f"), ((float)m_cEquipement.getFilterFromIndex(i))/1000);
		((CComboBox*)GetDlgItem(IDC_FILTER))->InsertString(-1,text);
	}

	return true;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : refreshAllLinkedBtn
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
bool CFrontEndDlg::refreshAllLinkedBtn(bool activate)
{
	bool ret = false;
	//Modulation
	std::vector<CData*> vector = m_cEquipement.getData(CDefinition::E_MODULATION).m_vcLinkedData;
	ret = refreshLinkedBtn(activate, vector);
	//voie
	vector = m_cEquipement.getData(CDefinition::E_CHANNEL).m_vcLinkedData;
	ret &= refreshLinkedBtn(activate, vector);

	RedrawWindow();
	return ret;
}
bool CFrontEndDlg::refreshLinkedBtn(bool activate, const std::vector<CData*> vector)
{
	bool ret = false;
	for (unsigned int i=0; i<vector.size(); i++)
	{
		int type = vector[i]->getType();
		std::map<int, CLedButton*>::iterator iter = m_mpEqtLinkedBtn.find(type);
		if (iter != m_mpEqtLinkedBtn.end())
		{
			if(!activate)
				m_mpEqtLinkedBtn[type]->setLedColor(CLedButton::E_NO_LED);
			else
			{
				if (vector[i]->isModifiable())
					m_mpEqtLinkedBtn[type]->setLedColor(CLedButton::E_RED);
				else
					m_mpEqtLinkedBtn[type]->setLedColor(CLedButton::E_NO_LED);
			}
			ret = true;
		}
	}
	return ret;
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : valideFrequency
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
bool CFrontEndDlg::valideFrequency()
{
	bool ret = true;
	double freq;
	CString sValue;
	int pos = 0; //toto
	int precision = 3;
	
	m_frequencyEdt.SetRedraw(TRUE);
 	if (m_isFrequencyEntered == FREQ_NOT_MODIFIED)
		return true;//la fréquence n'a pas été modifiée
	else if (m_isFrequencyEntered == FREQ_MODIFYING)
		return false;//état non permis
	m_frequencyEdt.GetWindowText(sValue);

	if (sValue == _T("."))
	{
		sValue = _T("0");
		m_frequencyEdt.SetWindowText(sValue);
	}
	// verification de la précision
	pos = sValue.Find(_T("."));
	if (pos != -1)
	{
		if (m_cEquipement.getData(CDefinition::E_FREQUENCY).getStep() == 10)
			precision = 3; // Hz
		else
			precision = 2; // dizaine de Hz

		if (sValue.GetLength()-pos>precision + 1)
		{
			CString nValue = sValue.Left(pos + precision+1);
			if (nValue == _T("."))
				nValue = _T("1");
			m_frequencyEdt.SetWindowText(nValue);
		}
	}
	

	// vérification de la valeur
	UpdateData(TRUE);
	OutputGenTrace(_T("CFrontEndDlg::valideFrequency - Mise à jour de la valeur\n"));
	if (!m_cEquipement.setValue(CDefinition::E_FREQUENCY,m_dFreqEdt*1000))	
	{
		freq = m_cEquipement.getValue(CDefinition::E_FREQUENCY);
		m_dFreqEdt = freq/1000; //en kHz
		ret = false;
	}
	UpdateData(FALSE);
	m_frequencyEdt.RedrawWindow();
	return ret;

}
///////////////////////////////////////////////////////////////////////////
// METHODE    : valideValue
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
bool CFrontEndDlg::valideAllValues()
{
	bool ret = true;

	UpdateData(TRUE);

	// sauvegarde de la fréquence
	if (!valideFrequency())
	{
		displayError();
		return false;
	}
	if (m_pActiveButton)
	{// si on est en cours de modif d'une valeur
		// désactivation du CEdit
		CWnd* pWnd = m_pActiveButton->getEdit();
		if (pWnd)
		{
			// Enregistrement de la nouvelle valeur
			double value;
			if (m_pActiveButton->getDisplayType() == CLedButton::E_COMBO)
			{
				value = ((CComboBox*)pWnd)->GetCurSel();
				if (value == -1)
					return false;
			}
			else if (m_pActiveButton->getDisplayType() == CLedButton::E_EDIT)
			{
				CString text;
				pWnd->GetWindowText(text);
				value = _wtof(text);
			}
			ret = m_cEquipement.setValue(m_pActiveButton->getEqt(),value);
			pWnd->EnableWindow(FALSE);
		}
		// la led retourne à sa valeur initiale
		m_pActiveButton->setLedColor(m_previousActiveButtonColor);	
		m_pActiveButton = NULL;
	}
	if (!ret)
		displayError();
	// affichage des boutons liés
	if (ret)
		refreshAllLinkedBtn(true);

	m_frequencyEdt.EnableWindow(TRUE);
	refreshCombos();
	displayResume();
	return ret;
}
