///////////////////////////////////////////////////////////////////////////
// METHODE    : displayError
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::displayConnecting(bool display)
{
	if (display)
	{
		CString connecting = _T("CONNECTING");
		CString tmp;
		m_ErrorEdt.GetWindowText(tmp);
		if (tmp != connecting)
			m_ErrorEdt.SetWindowText(connecting);
		m_ErrorEdt.ShowWindow(SW_SHOW);
		GetDlgItem(IDE_MISC)->ShowWindow(SW_HIDE);
		enableAll(false);
		m_ErrorEdt.SetSel(-1,0);
	}
	else
	{
		m_ErrorEdt.SetWindowText(_T("INPUT ERROR"));
		m_ErrorEdt.ShowWindow(SW_HIDE);
		GetDlgItem(IDE_MISC)->ShowWindow(SW_SHOW);
		enableAll(true);
	}
}

