///////////////////////////////////////////////////////////////////////////
// METHODE    : setStep
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::setStep()
{
	if( m_StepBtn.getLedColor() == CLedButton::E_RED)
		m_iStep = m_cEquipement.getStep(CDefinition::E_MEDSTEP);
	else if( m_StepBtn.getLedColor() == CLedButton::E_GREEN)
		m_iStep = m_cEquipement.getStep(CDefinition::E_FASTSTEP);
	else
		m_iStep = m_cEquipement.getStep(CDefinition::E_SLOWSTEP);
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : OnBnClick
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::OnBnClick(CLedButton& button, int eqtId, CString txt)
{
	if(m_isFrequencyEntered == FREQ_MODIFYING)
	{
		m_isFrequencyEntered = FREQ_MODIFIED;
	}

	// Si on appui sur le même bouton
	if (m_pActiveButton == &button)
	{
		valideAllValues();
		return;
	}

	// Si une autre valeur est en cours de modification
	if (m_pActiveButton)
	{
		// validation des valeurs
		if (!valideAllValues())
			return;
	}

	m_pActiveButton = &button;
	m_previousActiveButtonColor = button.getLedColor();
	
	// la led passe en vert
	button.setLedColor(CLedButton::E_GREEN);

	// active le CEdit indiqué
	CWnd* pWnd = button.getEdit();
	if (pWnd)
	{
		pWnd->EnableWindow(TRUE);
		pWnd->SetFocus();
		if (m_pActiveButton->getDisplayType() == CLedButton::E_EDIT)
			((CEdit*)pWnd)->SetSel( 0, -1);
		((CEdit*)GetDlgItem(IDE_FREQUENCY))->EnableWindow(FALSE);
	}
}

