///////////////////////////////////////////////////////////////////////////
// METHODE    : OnBnClickedEnter
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::OnBnClickedEnter()
{
	if (m_pActiveButton == &m_adrBtn )
	{
		UpdateData(TRUE);

		// on tente une nouvelle connection
		displayConnecting(true);
		SetTimer(ID_TIMER_CONNECTION, 5000, NULL);

		// on valide l'entrée
		CWnd* pWnd = m_adrBtn.getEdit();
		if (pWnd)
		{
			// Enregistrement de la nouvelle valeur
			m_cEquipement.setValue(CDefinition::E_CHANNEL,m_iAdrEdt);
			pWnd->EnableWindow(FALSE);
		}
		// la led retourne à sa valeur initiale
		m_adrBtn.setLedColor(CLedButton::E_NO_LED);	
		UpdateData(FALSE);
	}
	else if (m_isFrequencyEntered==FREQ_MODIFYING)
	{
		//on met à jour l'affichage
		m_isFrequencyEntered = FREQ_MODIFIED;
		valideAllValues();
	}
	if (m_isFrequencyEntered == FREQ_MODIFIED)
	{
		m_isFrequencyEntered = FREQ_NOT_MODIFIED;
		KillTimer(ID_TIMER_WHEEL);
	}
}
///////////////////////////////////////////////////////////////////////////
// METHODE    : OnBnClickedCe
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::OnBnClickedCe()
{
	// affichage des précédentes valeurs
	displayResume();
	// annule l'entrée en cours
	if (m_pActiveButton)
	{
		m_pActiveButton->setLedColor(m_previousActiveButtonColor);
		CWnd* pWnd = m_pActiveButton->getEdit();
		if (pWnd)
			pWnd->EnableWindow(FALSE);
		m_frequencyEdt.EnableWindow(TRUE);
		m_pActiveButton = NULL;

		RedrawWindow();
	}
	if (!m_cEquipement.isConnected())
	{
		// on tente une nouvelle connection
		displayConnecting(true);
		SetTimer(ID_TIMER_CONNECTION, 5000, NULL);
	}
	m_isFrequencyEntered = FREQ_NOT_MODIFIED;
	KillTimer(ID_TIMER_WHEEL);

}
///////////////////////////////////////////////////////////////////////////
// METHODE    : OnBnClickedSlfa
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::OnBnClickedSlfa()
{
	if( m_iStep == m_cEquipement.getStep(CDefinition::E_SLOWSTEP))
	{
		m_iStep = m_cEquipement.getStep(CDefinition::E_MEDSTEP);
		m_StepBtn.setLedColor(CLedButton::E_RED);
	}
	else if( m_iStep == m_cEquipement.getStep(CDefinition::E_MEDSTEP))
	{
		m_iStep = m_cEquipement.getStep(CDefinition::E_FASTSTEP);
		m_StepBtn.setLedColor(CLedButton::E_GREEN);
	}
	else
	{
		m_iStep = m_cEquipement.getStep(CDefinition::E_SLOWSTEP);
		m_StepBtn.setLedColor(CLedButton::E_NO_LED);
	} 
}
