///////////////////////////////////////////////////////////////////////////
// METHODE    : PreTranslateMessage
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
BOOL CFrontEndDlg::PreTranslateMessage(MSG* pMsg) 
{
	if(pMsg->message == WM_KEYDOWN && m_cEquipement.isConnected())
	{// si l'équipement n'est pas connecté, pas besoin de traiter differemment les appuis touches
		CString sValue;
		double dValue;
		if(pMsg->wParam == VK_PRIOR && m_FreqLockBtn.getLedColor() == CLedButton::E_NO_LED)
		{// Le bouton Lock bloque l'utilisation de la molette
			OutputGenTrace(_T("CFrontEndDlg::PreTranslateMessage - Detection page down\n"));
			// On active le timer
			if (m_isFrequencyEntered==FREQ_NOT_MODIFIED)
				SetTimer(ID_TIMER_WHEEL, 100, NULL);
			m_isFrequencyEntered = FREQ_MODIFYING;
			m_frequencyEdt.GetWindowText(sValue);
			dValue = _wtof(sValue) + m_iStep/1000;// affichage en kHz
			if (m_cEquipement.getData(CDefinition::E_FREQUENCY).getStep() == 1)
				sValue.Format(_T("%.03lf"),dValue);//pas d'1 Hz
			else
				sValue.Format(_T("%.02lf"),dValue);//pas d'une dizaine de Hz
			m_frequencyEdt.SetRedraw(FALSE);// la mise à jour est faite lors de la verification de la frequence
			m_frequencyEdt.SetWindowText(sValue);
			m_isFrequencyEntered = FREQ_MODIFIED;
			m_bFreqChange = true;
			OutputGenTrace(_T("CFrontEndDlg::PreTranslateMessage - Fin modif frequence\n"));
			return TRUE;
		}
		if(pMsg->wParam == VK_NEXT && m_FreqLockBtn.getLedColor() == CLedButton::E_NO_LED )
		{// Le bouton Lock bloque l'utilisation de la molette
			OutputGenTrace(_T("CFrontEndDlg::PreTranslateMessage - Detection page up\n"));
			if (m_isFrequencyEntered==FREQ_NOT_MODIFIED)
				SetTimer(ID_TIMER_WHEEL, 100, NULL);
			m_isFrequencyEntered = FREQ_MODIFYING;
			m_frequencyEdt.GetWindowText(sValue);
			dValue = _wtof(sValue) - m_iStep/1000;// affichage en kHz
			if (m_cEquipement.getData(CDefinition::E_FREQUENCY).getStep() == 1)
				sValue.Format(_T("%.03lf"),dValue);//pas d'1 Hz
			else
				sValue.Format(_T("%.02lf"),dValue);//pas d'une dizaine de Hz
			m_frequencyEdt.SetRedraw(FALSE);
			m_frequencyEdt.SetWindowText(sValue);
			m_isFrequencyEntered = FREQ_MODIFIED;
			m_bFreqChange = true;
			OutputGenTrace(_T("CFrontEndDlg::PreTranslateMessage - Fin modif frequence\n"));
			return TRUE;
		}
		if ((pMsg->wParam>=VK_NUMPAD0  && pMsg->wParam<=VK_NUMPAD9 ) || pMsg->wParam == VK_DECIMAL)
		{
			if (!m_pActiveButton)
			{
				m_frequencyEdt.SetFocus();
				if (m_isFrequencyEntered != FREQ_MODIFYING)
				{
					// s'il s'agit du 1ier chiffre entré, on force l'écriture du chiffre et on déplace le curseur
					CString tmp;
					if (pMsg->wParam == VK_DECIMAL)
						m_frequencyEdt.SetWindowText(_T("."));
					else
					{
						tmp.Format(_T("%d"), pMsg->wParam - VK_NUMPAD0);
						m_frequencyEdt.SetWindowText(tmp);
					}
					m_isFrequencyEntered = FREQ_MODIFYING;
					keybd_event(VK_RIGHT, 0, 0, NULL);
					return TRUE;
				}
			}
			return CDialog::PreTranslateMessage(pMsg);
		}
		if (pMsg->wParam != VK_RETURN  && pMsg->wParam != VK_ESCAPE  && pMsg->wParam != VK_RIGHT)
			return true;
	}
	return CDialog::PreTranslateMessage(pMsg);
}

///////////////////////////////////////////////////////////////////////////
// METHODE    : PreTranslateMessage
// CLASSE     : CFrontEndDlg
///////////////////////////////////////////////////////////////////////////
void CFrontEndDlg::OnTimer(UINT nIDEvent)
{
	switch(nIDEvent)
	{
	case ID_TIMER_ERROR:
		m_ErrorEdt.ShowWindow(SW_HIDE);
		GetDlgItem(IDE_MISC)->ShowWindow(SW_SHOW);
		KillTimer(ID_TIMER_ERROR);
		break;
	case ID_TIMER_CONNECTION:
		if (m_cEquipement.isConnected())
		{
			displayConnecting(false);
			KillTimer(ID_TIMER_CONNECTION);
			m_cEquipement.getCurrentChannelStatus();
			valideAllValues();
			setStep();
		}
		else
		{// on attends la connection
			displayConnecting(true);
			m_cEquipement.connect();
		}
		break;
	case ID_TIMER_WHEEL:
		if (m_bFreqChange)
		{
			valideFrequency();
			m_bFreqChange = false;
		}
		break;
	default:
		break;
	}

	CDialog::OnTimer(nIDEvent);
}

