void CFrontEndDlg::OnKeypadBnClicked(int keyValue)
{
	// WARNING: si le focus n'est pas setté, l'appui touche est envoyé au control actif
	// On met donc à jour le focus sur le control qui doit récupèrer l'évènement
	if (GetDlgItem(IDE_ADR)->IsWindowEnabled())
		GetDlgItem(IDE_ADR)->SetFocus();
	else
		m_frequencyEdt.SetFocus();	
	keybd_event(keyValue, 0x45, KEYEVENTF_EXTENDEDKEY | 0, 0);
}
