///////////////////////////////////////////////////////////////////////////
// METHODE    : setImage
// CLASSE     : CLedButton
///////////////////////////////////////////////////////////////////////////
void CLedButton::setLedColor(E_Color color)
{
	m_eLedColor = color;
		
	// suppression de la précédente image
	m_ledImgLst.Remove(0);
	// ajout de la nouvelle image
	CBitmap m_led;
	switch(m_eLedColor)
	{
	case E_RED:
		m_led.LoadBitmap(IDB_REDLED);
		break;
	case E_BLUE:
		m_led.LoadBitmap(IDB_BLUELED);
		break;
	case E_GREEN:
		m_led.LoadBitmap(IDB_GREENLED);
		break;
	case E_NO_LED:// aucune image d'insérée
	default:
		m_led.LoadBitmap(IDB_EMPTY);
	}
	m_ledImgLst.Add(&m_led, RGB(0xFF,0xFF,0xFF));

	// si la led est active
	BUTTON_IMAGELIST* pbil;
	pbil = new BUTTON_IMAGELIST;
	if (pbil)
	{
		RECT r={3,3,3,3};
		pbil->himl = m_ledImgLst.m_hImageList;
		pbil->margin = r;
		pbil->uAlign = BUTTON_IMAGELIST_ALIGN_LEFT;
		SetImageList(pbil);
	}
	delete pbil;
}

