#pragma once
#include <map>
#include "Definition.h"
#include "Data.h"
#include ".\mytelec8025.h"

/**
 * \author Nathalie Laborde
 * \date 2007
 * \brief Classe de definition d'une voie.
 *
 * La classe gère l'ensemble des paramètres utilisé par une voie 
 * de l'équipement.\n
 * Utilisation :\n
 */
class CChannel
{
public:
	/**
	 * \brief constructeur par défaut.
	 */
	CChannel();
	/**
	 * \brief destructeur.
	 */
	~CChannel();

	/**
	 * \brief mémorise la nouvelle valeur de la donnée id.
	 * @param id identifiant de la donnée
	 * @param value valeur de la donnée
	 */
	virtual bool setValue(int id, double value);
	/**
	 * \brief incrémente et récupére la nouvelle valeur de la donnée id.
	 * @param id identifiant de la donnée
	 */
	virtual double nextValue(int id);
	/**
	 * \brief retourne la valeur de la donnée id.
	 * @param id identifiant de la donnée
	 */
	virtual double getValue(int id);
	/**
	 * \brief retourne la donnée id.
	 * @param id identifiant de la donnée.
	 */
	virtual CData getData(int id);
	/**
	 * \brief retourne la valeur du pas de fréquence.
	 * la valuer du pas diffère selon la voie sélectionnée.
	 * @param type type de pas
	 */
	virtual int getStep(CDefinition::E_StepType type)=0;
	/**
	 * \brief récupère les informations de la voie.
	 */
	virtual bool getStatus();
	/**
	 * \brief retourne la valeur en Hz du filtre selectionné.
	 * @param value index dans l'enum de chaque voie.
	 */
	virtual long getFilterFromIndex(const int value)=0;
	/**
	 * \brief retourne l'index dans l'enum du filtre selectionné.
	 * @param value valeur du filtre en Hz.
	 */
	virtual int getFilterFromValue(const long value)=0;
	/**
	 * \brief retourne le nombre de filtre possible.
	 */
	virtual int getFilterCount()=0;
	/**
	 * \brief indique si la voie est connecté ou pas.
	 */
	virtual bool isConnected(){return m_isConnected;};

	/**
	 * \brief connection à la voie correspondant sur le 8025.
	 */
	virtual void connect();

protected:
	/**
	 * \brief envoie les valeurs de veille callée à l'équipement.
	 * uniquement la valeur spécifié dans l'id est envoyé
	 * @param id identifiant de la donnée.
	 * @param value valeur de la donnée
	 */
	virtual bool sendCalValue(int id, double value);
	/**
	 * \brief envoie la valeur de la modulation à l'équipement.
	 * @param voie numéro de la voie
	 * @param value valeur de la donnée
	 */
	virtual bool sendModulation(int voie, CDefinition::E_Modulation value);
	/**
	 * \brief envoie la valeur du filtre à l'équipement.
	 * @param voie numéro de la voie
	 * @param value valeur de la donnée
	 * @param mod valeur de la modulation
	 */
	virtual bool sendBandwidth(int voie, int value, CDefinition::E_Modulation mod) = 0;
	/**
	 * \brief récupère la valeur de la modulation.
	 * @param channelStatus état du canal
	 */
	virtual CDefinition::E_Modulation getModulation(const telec8025::t_channelstatus channelStatus);
	/**
	 * \brief met en place les données par défaut.
	 */
	virtual bool dataInitialisation()=0;
	/**
	 * \brief met à jour les autres valeurs en fonction de la donnée modifiée.
	 * @param id identifiant de la donnée modifiée.
	 * @param value valeur de la donnée modifiée.
	 */
	virtual void updateOthers(int id, double value)=0;

	static CMyTelec8025 m_ctelec8025; /* ! appareil 8025 */	
	std::map<int, CData> m_mpData;	/* ! map des données de la voie */
	bool m_isConnected; /* ! indicateur de connection au 8025 */
};

#pragma once
#include <vector>

/**
 * \author Nathalie Laborde
 * \date 2007
 * \brief Classe de definition d'un parametre de la voie.
 *
 * La classe gère l'ensemble des paramètres utilisés par une voie 
 * de l'équipement.\n
 * Utilisation :\n
 */
class CData
{
public:
	/**
	 * \brief constructeur par défaut.
	 */
	CData();
	/**
	 * \brief destructeur.
	 */
	~CData(void);
	/**
	 * \brief met à jour  la valeur minimale possible pour la donnée.
	 * si le minimum à mémoriser est supérieur à la valeur,
	 * alors la valeur est modifiée et fixée au nouveau minimum.
	 * @param min valeur minimale
	 */
	virtual bool setMin(double min);
	/**
	 * \brief met à jour  la valeur maximale possible pour la donnée.
	 * si le maximum à mémoriser est inférieur à la valeur,
	 * alors la valeur est modifiée et fixée au nouveau maximum.
	 * @param max valeur minimale
	 */
	virtual bool setMax(double max);
	/**
	 * \brief met à jour la valeur de la donnée.
	 * Retourne true si la mise à jour de la valeur a été faite.
	 * @param value valeur
	 */
	virtual bool setValue(double value);
	/**
	 * \brief met à jour  le pas de modification de la donnée.
	 * si le pas est 0, alors la valeur est considérée comme constante
	 * @param step pas
	 */
	virtual bool setStep(double step);
	/**
	 * \brief mémorise le type de la donnée.
	 * @param type type
	 */
	virtual void setType(int type){m_eType=type;};
	/**
	 * \brief retourne la valeur maximale de la donnée. 
	 */
	virtual double getMax() const {return m_slMax;};
	/**
	 * \brief retourne la valeur minimale de la donnée. 
	 */
	virtual double getMin() const {return m_slMin;};
	/**
	 * \brief retourne la valeur de la donnée. 
	 */
	virtual double getValue() const {return m_slValue;};
	/**
	 * \brief retourne le pas de la donnée. 
	 */
	virtual double getStep() const {return m_lStep;};
	/**
	 * \brief retourne le pas de la donnée. 
	 */
	virtual int getType() const {return m_eType;};
	/**
	 * \brief retourne vrai si la valeur est valide. 
	 */
	virtual bool isValid(const double value) const;
	/**
	 * \brief authorise ou non de modifier la donnée. 
	 * Cette fonction est utilisée lorsque la modification d'une valeur entraine
	 * l'autorisation ou non d'une autre (exm: modifier la modulation peut laisser
	 * l'utilisateur libre de modifier le BFO.)
	 * @param allow authorise ou non la modification de la donnée.
	 */
	virtual void allowModification(const bool allow){m_allowModification = allow;};
	/**
	 * \brief retourne vrai si la valeur est valide . 
	 */
	virtual bool isModifiable()const {return m_allowModification;} ;
	/**
	 * \brief surchage de l'opérateur "++".
	 */
	virtual CData& operator++ ();
	/**
	 * \brief surchage de l'opérateur "--".
	 */
	virtual CData& operator-- ();

	std::vector<CData*> m_vcLinkedData;	// données dépendantes
protected:
	
	double m_slMax; /* ! valeur maximale de la donnée */
	double m_slMin; /* ! valeur minimal de la donnée */
	double m_slValue; /* ! valeur de la donnée */
	double m_lStep; /* ! pas de la donnée */
	bool m_allowModification; /* ! peut on modifier la valeur de la donnée */
	int m_eType; /* ! type de la donnée */
};

