	/**
	 * \brief indique si la voie a pu se connecter ou pas.
	 */
	virtual bool isConnected(){return m_pCurrentChannel->isConnected();};
	/**
	 * \brief met à jours les valeurs de la voie selectioonée.
	 */
	virtual bool getCurrentChannelStatus(){return m_pCurrentChannel->getStatus();;};
protected:
	/**
	 * \brief mise à jour de la nouvelle voie sélectionné.
	 * @param voie numéro de la nouvelle voie à setter.
	 */
	bool setCurrentChannel(int voie);

	std::vector<CChannel*> m_mpChannel;	/* ! map des données de la voie */
	CChannel* m_pCurrentChannel;	/* ! voie active */
};

