#include "Resource.h"

/**
 * \author Nathalie Laborde
 * \date 2007
 * \brief Classe de definition d'un boutton.
 *
 * La classe gère l'affichage de la fenêtre et traite les données à envoyer
 * à chacune des voies de l'équipement.\n
 * Utilisation :\n
 */
class CLedButton : public CButton
{
	DECLARE_MESSAGE_MAP()
public:
	enum E_Color
	{
		E_NO_LED =0,
		E_RED,
		E_BLUE,
		E_GREEN
	};
	enum E_DisplayType
	{
		E_COMBO =0,
		E_EDIT
	};
	/**
	 * \brief constructeur par défaut.
	 */
	CLedButton();
	/**
	 * \brief destructeur.
	 */
	~CLedButton();
	/**
	 * \brief ajout de l'image sur le bouton. 
	 * @param color couleur de la led.
	 */
	void setLedColor(E_Color color);
	/**
	 * \brief retourne la couleur affichée sur la led du bouton. 
	 */
	E_Color getLedColor() {return m_eLedColor;};
	/**
	 * \brief met à jour l'endroit où doit être affiché la valeur. 
	 * @param pedit control d'édition auquel est lié le bouton.
	 */
	void setEdit(CWnd* pedit) {m_pDisplayCtrl = pedit;};
	/**
	 * \brief retourne l'endroit où doit être affiché la valeur. 
	 */
	CWnd* getEdit() {return m_pDisplayCtrl;};
	/**
	 * \brief met à jour l'endroit où doit être affiché la valeur. 
	 */
	E_DisplayType getDisplayType() {return m_eDisplayType;};
	/**
	 * \brief met à jour l'endroit où doit être affiché la valeur. 
	 * @param type type du control d'édition auquel est lié le bouton.
	 */
	void setDisplayType(E_DisplayType type) {m_eDisplayType = type;};
	/**
	 * \brief retourne le nom de la donnée auquel est lié le bouton. 
	 */
	int getEqt() {return m_iEqtId;};
	/**
	 * \brief met à jour le nom de la donnée auquel est lié le bouton. 
	 * @param eqt le nom de la donnée auquel est lié le bouton.
	 */
	void setEqt(int eqt) {m_iEqtId = eqt;};

protected:
	E_Color m_eLedColor;
	CImageList m_ledImgLst;
	E_DisplayType m_eDisplayType;
	CWnd* m_pDisplayCtrl; // endroit ou sera affiché la valeur correspondante
	int m_iEqtId;
};
